import React from "react";
import MenuItem from "./MenuItem";

function Menu(props) {
  return (
    <div className="nav navbar-nav">
                {props.items.map(item => (
                    <MenuItem key={item.id} name={item.name} url={item.url} />
                    ))}
    </div>

  );
}
export default Menu;
